import React from 'react';
import Question from './Question';

export default function SingleGame() {
    const questions = [
        {
            question: 'Who is the author of "The Bitcoin Standard"?',
            answers: [
                'Saifedean Ammous',
                'Parker Lewis',
                'Michael Saylor',
                'Preston Pysh'
            ],
            labels: [
                'People'
            ]
        }
    ]


    return <Question question={questions[0]}/>;
}
